import {connect}        from 'react-redux';
import MyProfile        from '../../components/profile/MyProfile';
import {getMyOrgs, getMyProfileData} from "../../actions/profileApi";

const mapStateToProps = (state) => ({
    myUsername: (state.myProfileData && state.myProfileData.username) || `Paw Citizen ${state.myProfileData && state.myProfileData.id}`.trim(),
    myPoints: (state.myProfileData && state.myProfileData.points),
    //TODO - update this url to pull from api once we handle image upload
    myProfileImageUrl: state.myProfileImageUrl || "https://i.pinimg.com/originals/7d/ad/68/7dad68f5621e8b7d675eac0bbb904c33.jpg",
    myOrgs: state.myOrgs
});

const mapDispatchToProps = (dispatch) => ({
    fetchUserData: () => dispatch(getMyProfileData),
    fetchUserOrgs: () => dispatch(getMyOrgs)
});

export default connect(mapStateToProps, mapDispatchToProps)(MyProfile);
